INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (3, 0, 534, 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 2, 60003, 0, 0, "", 1, "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (3, 0, 535, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 60003, 0, 0, "", 1, "");
